import Layout from '../components/Layout';

const Auth = () => (
  <Layout>
    <section id="auth" className="container">
      <h1>Login</h1>
      <form>
        <div className="form-control">
          <label htmlFor="email">Email</label>
          <input type="email"/>
        </div>
        <div className="form-control">
          <label htmlFor="password">Password</label>
          <input type="password"/>
        </div>
      </form>





      <style jsx>{`
    
      #navbar {
        padding: 1.5rem 0;
        border-bottom: 1px solid white;
      }
    
      #nav-content {
        display: flex;
        justify-content: space-between;
        align-items: center;
      }

      #logo h1 {
        color: white;
        font-size: 2rem;
        text-transform: uppercase;
      }

      .nav-link {
        color: white;
        margin: 0.5rem;
      }

      #search {
        width: 50%;
      }

      #searchbar{
        width: 100%;
      }

      label {
        position: absolute;
        top: 10px;
        left: 12px;
      }
      
      #main-searchbar {
        margin: auto;
        display: flex;
        position: relative;
      }

      #main-searchbar input {
        width: 100%;
        border-radius: 23px;
        padding: 0.6rem 0.5rem 0.5rem 2.3rem;
        font-size: 1.1rem;
        border: none;
      }

      #main-searchbar input :focus {
        outline: none;
      }

    `}</style>

    </section>
  </Layout>
);

export default Auth;
